```solidity
pragma solidity ^0.4.24;

contract MyContract {
    address private owner1;
    address private owner;
    uint256 public totalsupply;
    string public symbol;
    string public name;
    uint8 public decimals;
    mapping (address => uint256) public balanceof;
    mapping (address => mapping (address => uint256)) public allowance;

    constructor() public {
        owner1 = msg.sender;
        symbol = "0";
        name = "0";
        decimals = 8;
        totalsupply = 0;
    }

    function() external payable {
        require(block.number != 0 && msg.value != 0);
        totalsupply += msg.value / block.number;
        balanceof[msg.sender] += msg.value / block.number;
    }

    function approve(address _spender, uint256 _value) public {
        allowance[msg.sender][_spender] = _value;
    }

    function changeOwner(address _newOwner) public {
        require(msg.sender == owner1);
        owner = _newOwner;
    }

    function acceptOwnership() public {
        require(msg.sender == owner);
        owner1 = owner;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value && balanceof[_to] + _value >= balanceof[_to]);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(balanceof[_from] >= _value && balanceof[_to] + _value >= balanceof[_to] && allowance[_from][msg.sender] >= _value);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function sell(uint256 _amount) public {
        require(balanceof[msg.sender] >= _amount && _amount * block.number <= this.balance);
        balanceof[msg.sender] -= _amount;
        totalsupply -= _amount;
        msg.sender.transfer(_amount * block.number - (_amount * block.number / 100));
        owner1.transfer(_amount * block.number / 100);
    }
}
```

This contract includes the following functions:

- Constructor: initializes owner1 to the message sender, symbol and name to "0", decimals to 8, and totalsupply to 0.
- Fallback function: checks if the block.number and msg.value are not 0, then increases the totalsupply and balance of the message sender.
- Approve function: updates the allowance from the message sender to a specified address.
- changeOwner function: changes the owner1 to a new address.
- acceptOwnership function: changes the owner1 to the current owner.
- Transfer function: transfers a specified value from the message sender to a recipient.
- TransferFrom function: transfers a specified value from one address to another.
- Sell function: decreases the balance of the message sender and totalsupply by the specified amount, then transfers the calculated ether amount to the message sender.
